import Navbar from '../components/navbar/Navbar';
import './AllProjects.scss'


export default function PvsZ() {
  return (
    <div>
      <Navbar />
      <div className="main-container">
        <h2 className="project-name">Plants Vs Zombies Clone</h2>
      </div>
    </div>
  )
}
